import React, { Component } from 'react';
import { Link } from 'react-router-dom';

/**
 * This component loads the short list of my events on the networking-home.component
 */
export default class ShortPublicEventsComponent extends React.Component {
    constructor(props) {
        super(props);
    }

    //TODO: replace dummy content with database entries
    render() {
        return (
            <div className="eventPublicListHolder">
                <h2>Public Events</h2>
                <p>Latest Events:</p>
                <div className="container">
                    <div className="row">
                        <div className="col-sm">
                            <h5>Dummy Content Meetup</h5>
                            <div>Mississauga, ON | Friday June 12 2020</div>
                            <div><Link to="/networking-events/details/1">Details</Link></div>
                        </div>
                        <div className="col-sm">
                            <h5>Lorem Ipsum Convetion</h5>
                            <div>Toronto, ON | Tuesday June 9 2020</div>
                            <div><Link to="/networking-events/details/1">Details</Link></div>
                        </div>
                        <div className="col-sm">
                            <h5>Microsoft Code Zone</h5>
                            <div>Toronto, ON | Saturday June 6 2020</div>
                            <div><Link to="/networking-events/details/1">Details</Link></div>
                        </div>
                    </div>
                </div>
                <div class="d-flex justify-content-end">
                    <Link to="/networking-events/public-events">See More &rarr;</Link>
                </div>
            </div>
        );
    }
}
